import './App.css';
import data from "./data"; 

const socialMediaList = data.SocialMedias;

function App() {
  return (
    <div className="App">
          <Display></Display>
    </div>
  );
}

const Display = (props)=> {
		return (
            <ul>
                {socialMediaList.map(s => (<li>{s}</li>))}
            </ul>
        );
} 
export default App;
